from typing import Dict, Listclass Shop:    def __init__(self, name: str, location: Dict, product_cart: List,) -> None:        self.name = name        self.location = location        self.product_cart = product_cart        self.FUEL_PRICE = int    def shopping_cost(self, product_cart: List) -> int:        total_cost = 0        for product in product_cart.keys():            total_cost += self.product_cart[product] * product_cart[product]        return round(total_cost, 2)    def generate_receipt(self, customer, current_time):        receipt = f"Date: {current_time}\nThanks, {customer.name}, for your purchase!\nYou have bought:"        total_cost = 0        for product, quantity in customer.product_cart.items():            if product in self.product_cart:                product_cost = self.product_cart[product]                product_total_cost = product_cost * quantity                if product_total_cost % 1 == 0:                    receipt += (                        f"\n{quantity} {product}s for {int(product_total_cost)} dollars\n"                    )                else:                    receipt += (                        f"{quantity} {product}s for {product_total_cost} dollars\n"                    )            trip_cost = customer.calculate_trip_cost(self, self.FUEL_PRICE)            left_money = round(customer.money - trip_cost, 2)        receipt += f"\nTotal cost is {total_cost} dollars\nSee you again!\n\n{customer.name} rides home\n{customer.name} now has {left_money} dollars\n"        return receipt